const About = () => (
  <div className="container mt-4">
    <h2>Om Svenska Elsparkcyklar AB</h2>
    <p>
      Det här är en elsparkcykel-tjänst för svenska städer. Här kan du läsa mer om företaget, våra tjänster och vision!
    </p>
  </div>
);

export default About;
